import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import "../css/page/Re";

function RegisterPage() {
  const initialData = {
    fullName: "",
    email: "",
    password: "",
    gender: "MALE",
    phone: "",
  };

  const [data, setData] = useState(initialData);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChangeInput = (e) => {
    const { name, value } = e.target;
    setData({ ...data, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);

    axios
      .post("http://localhost:8080/api/auth/register", data)
      .then((res) => {
        if (res.status === 201) {
          toast.success("ﾄ斉ハg kﾃｽ thﾃnh cﾃｴng 沁噂

/verify-register", { state: { email: data.email } });
          }, 1500);
        } else {
          toast.error("ﾄ斉ハg kﾃｽ th蘯･t b蘯｡i, vui lﾃｲng th盻ｭ l蘯｡i!");
        }
      })
      .catch(() => {
        toast.error("ﾄ斉ハg kﾃｽ th蘯･t b蘯｡i, vui lﾃｲng th盻ｭ l蘯｡i!");
      })
      .finally(() => setLoading(false));
  };

  return (
    <div className="register-page">
      <div className="register-card">
        <h2 className="register-title">Create Your Account</h2>
        <p className="register-subtitle">
          Join us and explore the experience
        </p>

        <form onSubmit={handleSubmit}>
          <div className="register-group">
            <label>Full Name</label>
            <input
              name="fullName"
              placeholder="Enter your full name"
              onChange={handleChangeInput}
            />
          </div>

          <div className="register-group">
            <label>Email</label>
            <input
              type="email"
              name="email"
              placeholder="Enter your email"
              onChange={handleChangeInput}
            />
          </div>

          <div className="register-group">
            <label>Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter your password"
              onChange={handleChangeInput}
            />
          </div>

          <div className="register-group">
            <label>Gender</label>
            <div className="gender-group">
              <label>
                <input
                  type="radio"
                  name="gender"
                  value="MALE"
                  defaultChecked
                  onChange={handleChangeInput}
                />{" "}
                Male
              </label>
              <label>
                <input
                  type="radio"
                  name="gender"
                  value="FEMALE"
                  onChange={handleChangeInput}
                />{" "}
                Female
              </label>
            </div>
          </div>

          <div className="register-group">
            <label>Phone</label>
            <input
              name="phone"
              placeholder="Enter your phone number"
              onChange={handleChangeInput}
            />
          </div>

          <button className="register-btn" disabled={loading}>
            {loading && (
              <span className="spinner-border spinner-border-sm"></span>
            )}
            {loading ? "Registering..." : "Register Now"}
          </button>
        </form>
      </div>

      <ToastContainer />
    </div>
  );
}

export default RegisterPage;
